import React from 'react';
import {Route} from 'react-router-dom'

export default function Navbar() {
  return (
		<nav>
			<Route>
				<div className="logo">
					<img
						src="imgs/bakersinnlogo.png"
						className="img-fluid"
						alt=""
					/>
				</div>
				<ul>
					<li>
						{" "}
						<Route>About us</Route>{" "}
					</li>
					<li>
						{" "}
						<Route>Products</Route>{" "}
					</li>
					<li>
						{" "}
						<Route>Recipes</Route>{" "}
					</li>
					<li>
						{" "}
						<Route>Kid's Corner</Route>{" "}
					</li>
					<li>
						{" "}
						<Route className="contact">Contact Us</Route>{" "}
					</li>
				</ul>
			</Route>
		</nav>
  );
}
